import React from 'react';

const Nav = ({ children }) => ({
    type: 'nav',        
    props: {
        className: 'top__menu',
        children: [{
            type: 'span',
        }, {
            type: 'ul',
            props: {
                children: children
            }
        }]
    }
})

export default Nav;
